END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_agregar_categoria` (IN `p_nombre` VARCHAR(100), IN `p_descripcion` TEXT)   BEGIN
    -- Verificar si el nombre ya existe
    IF NOT EXISTS (
        SELECT 1
        FROM categoria
        WHERE nombre = p_nombre
    ) THEN
        -- Insertar la nueva categoría
        INSERT INTO categoria (nombre, descripcion)
        VALUES (p_nombre, p_descripcion);
    ELSE
        -- Mensaje de error si el nombre ya existe (opcional)
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'El nombre de la categoría ya existe.';
    END IF;
END$$

