CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_alumnos_inscritos` (IN `p_id_usuario` INT, IN `p_fecha_inicio` DATE, IN `p_fecha_fin` DATE, IN `p_categoria_id` INT, IN `p_activo` BOOLEAN)   BEGIN
    SELECT V.id_alumno,
           V.Curso, -- Nombre del curso
           V.Curso_st, 
           V.Alumno, -- Alumno
           V.Nivel_actual,
           V.Inscripcion, -- fecha
           V.Pago -- pago + FaltaForma de pago default tarjeta
    FROM vista_AlumnosInscritos V
    WHERE (V.Maestro_ID = p_id_usuario OR p_id_usuario IS NULL OR p_id_usuario = 0)
      AND (V.Inscripcion >= p_fecha_inicio OR p_fecha_inicio IS NULL)
      AND (V.Inscripcion <= p_fecha_fin OR p_fecha_fin IS NULL)
      AND (V.Categoria_ID = p_categoria_id OR p_categoria_id = 0 OR p_categoria_id IS NULL)
      AND (V.Curso_st = p_activo OR p_activo IS NULL)
    ORDER BY V.Curso;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_busqueda` (IN `fecha_min` DATE, IN `fecha_max` DATE, IN `id_categoria` INT, IN `texto` VARCHAR(255), IN `id_usuario` INT)   BEGIN
    SELECT 
        c.id,
        c.titulo,
        c.descripcion,
        c.precio,
        c.contenido,
        c.id_maestro,
        c.id_categoria,
        c.foto,
        c.niveles,
        c.fe_Creacion,
        c.status,
        u.nombre_usuario AS nombre_maestro,
        ca.nombre AS categoria_nombre,
        -- Verificar si el usuario está inscrito en el curso
        IF(i.id_alumno IS NULL, 0, 1) AS estado_inscripcion
    FROM 
        curso c
    LEFT JOIN usuario u ON c.id_maestro = u.id
    LEFT JOIN categoria ca ON c.id_categoria = ca.id
    LEFT JOIN inscripcion i ON i.id_curso = c.id AND i.id_alumno = id_usuario
    WHERE 
        (fecha_min IS NULL OR c.fe_Creacion >= fecha_min) AND
		(c.status = 1) AND
        (fecha_max IS NULL OR c.fe_Creacion <= fecha_max) AND
        (id_categoria IS NULL OR c.id_categoria = id_categoria) AND
        (c.titulo LIKE CONCAT('%', texto, '%') OR 
         u.nombre_usuario LIKE CONCAT('%', texto, '%'))
    ORDER BY c.fe_Creacion DESC;
END$$

