CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_EditCurso` (IN `p_id_curso` INT, IN `p_titulo` VARCHAR(255), IN `p_descripcion` TEXT, IN `p_precio` DECIMAL(10,2), IN `p_id_categoria` INT, IN `p_foto` BLOB, IN `p_id_maestro` INT)   BEGIN
    -- Verify the course belongs to the professor
    IF EXISTS (SELECT 1 FROM curso WHERE id = p_id_curso AND id_maestro = p_id_maestro) THEN
        UPDATE curso 
        SET titulo = p_titulo,
            descripcion = p_descripcion,
            precio = p_precio,
            id_categoria = p_id_categoria,
            foto = COALESCE(p_foto, foto) -- Only update if new photo provided
        WHERE id = p_id_curso AND id_maestro = p_id_maestro;
        
        SELECT TRUE as success, 'Curso actualizado exitosamente' as message;
    ELSE
        SELECT FALSE as success, 'No tienes permiso para editar este curso' as message;
    END IF;
END$$

