CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_resumen_curso` (IN `p_id_usuario` INT, IN `p_fecha_inicio` DATE, IN `p_fecha_fin` DATE, IN `p_categoria_id` INT, IN `p_activo` BOOLEAN)   BEGIN
    SELECT V.ID_Curso, -- Num
           V.id_maestro, -- 
           V.Nombre, -- Nombre
           V.Curso_st,
           V.Fecha_creacion, -- Fecha creacion
           V.Categoria_ID,
           V.Categoria, -- Categoria
           V.Alumnos_inscritos, -- Alumnos Inscritos 
           V.Ingresos_totales -- Ingresos totales
    FROM vista_ResumenCurso V
    WHERE (V.Fecha_creacion >= p_fecha_inicio OR p_fecha_inicio IS NULL)
      AND (V.Fecha_creacion <= p_fecha_fin OR p_fecha_fin IS NULL)
      AND (V.Categoria_ID = p_categoria_id OR p_categoria_id = 0 OR p_categoria_id IS NULL)
      AND (V.Curso_st = p_activo OR p_activo IS NULL)
      AND (V.id_maestro = p_id_usuario OR p_id_usuario IS NULL OR p_id_usuario = 0)
    ORDER BY V.ID_Curso;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_soft_delete_curso` (IN `p_id_curso` INT, IN `p_id_profesor` INT)   BEGIN
    -- Verify the course exists and belongs to the professor
    IF EXISTS (SELECT 1 FROM curso WHERE id = p_id_curso AND id_maestro = p_id_profesor) THEN
        UPDATE curso 
        SET status = 0 
        WHERE id = p_id_curso AND id_maestro = p_id_profesor;
        SELECT TRUE as success, 'Curso desactivado exitosamente' as message;
    ELSE
        SELECT FALSE as success, 'No se encontró el curso o no tienes permiso para eliminarlo' as message;
    END IF;
END$$

