DROP TABLE IF EXISTS `vista_alumnorpt`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vista_alumnorpt`  AS SELECT `u`.`id` AS `ID`, `u`.`intentos_fallidos` AS `intentos`, `u`.`estado` AS `estado`, concat(`u`.`nombre`,' ',`u`.`apellidos`) AS `Nombre`, `u`.`fecha_creacion` AS `Fecha_ingreso`, count(`i`.`id_curso`) AS `Cursos_inscritos`, round(sum(case when `k`.`lvl_Actual` >= `c`.`niveles` then 1 else 0 end) / count(`i`.`id_curso`) * 100,2) AS `Porcentaje_terminados` FROM (((`usuario` `u` left join `inscripcion` `i` on(`i`.`id_alumno` = `u`.`id`)) left join `curso` `c` on(`c`.`id` = `i`.`id_curso`)) left join `kardex` `k` on(`k`.`id_alumno` = `u`.`id` and `k`.`id_curso` = `c`.`id`)) WHERE `u`.`tipo_usuario` = 1 GROUP BY `u`.`id` ;

