CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vista_alumnosinscritos`  AS SELECT `i`.`id_alumno` AS `id_alumno`, `c`.`titulo` AS `Curso`, `c`.`id_maestro` AS `Maestro_ID`, `c`.`status` AS `Curso_st`, `u`.`nombre` AS `Alumno`, `k`.`lvl_Actual` AS `Nivel_actual`, `i`.`fecha_inscripcion` AS `Inscripcion`, `t`.`monto` AS `Pago`, `cat`.`id` AS `Categoria_ID`, `cat`.`nombre` AS `Categoria` FROM (((((`curso` `c` join `categoria` `cat` on(`c`.`id_categoria` = `cat`.`id`)) join `inscripcion` `i` on(`i`.`id_curso` = `c`.`id`)) join `usuario` `u` on(`u`.`id` = `i`.`id_alumno`)) left join `kardex` `k` on(`k`.`id_curso` = `c`.`id` and `k`.`id_alumno` = `i`.`id_alumno`)) left join `transaccion` `t` on(`t`.`id_curso` = `c`.`id` and `t`.`id_alumno` = `i`.`id_alumno` and `t`.`estatus` = 1)) ;

