CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vista_curso_detalle`  AS SELECT `c`.`id` AS `id`, `c`.`titulo` AS `titulo`, `c`.`descripcion` AS `descripcion`, `c`.`precio` AS `precio`, `c`.`contenido` AS `contenido`, `c`.`id_maestro` AS `id_maestro`, `c`.`id_categoria` AS `id_categoria`, `c`.`foto` AS `foto`, `c`.`niveles` AS `niveles`, `c`.`fe_Creacion` AS `fe_Creacion`, `c`.`status` AS `status`, `cat`.`nombre` AS `categoria`, concat(`u`.`nombre`,' ',`u`.`apellidos`) AS `autor`, count(distinct `i`.`id_alumno`) AS `total_inscritos`, avg(case when `com`.`id` is not null then 1 else 0 end) AS `promedio_calificacion` FROM ((((`curso` `c` join `categoria` `cat` on(`c`.`id_categoria` = `cat`.`id`)) join `usuario` `u` on(`c`.`id_maestro` = `u`.`id`)) left join `inscripcion` `i` on(`i`.`id_curso` = `c`.`id`)) left join `comentario` `com` on(`com`.`id_curso` = `c`.`id`)) WHERE `c`.`status` = 1 GROUP BY `c`.`id` ;

