CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_reporte_categorias_creadas`  AS SELECT `ac`.`id_admin` AS `id_admin`, `u`.`nombre_usuario` AS `nombre_admin`, count(`ac`.`id`) AS `total_categorias`, cast(`ac`.`fecha_creacion` as date) AS `fecha_creacion` FROM (`reporte_categoria` `ac` join `usuario` `u` on(`ac`.`id_admin` = `u`.`id`)) GROUP BY `ac`.`id_admin`, `u`.`nombre_usuario`, cast(`ac`.`fecha_creacion` as date) ;

